import React from "react";
import Nav from "./components/Nav";
import Header from "./pages/landing/Header";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Layout />}>
          <Route index element={<Landing />} />
        </Route>
      </Routes>
    </Router>
  );
}

export default App;
